import react from 'react'

// specjalizacje - we receive array of objects containing specialty's name and description
export default function DoctorsSpecialtyAside({data}) {
  console.log("data", data)
  specjailizacje = data.specjailizacje

  console.log("specjal", specjailizacje)

  return (
    <>
      <div className='h-full w-24 bg-violet-600 shadow shadow-violet-800 flex flex-col'>
        {specjalizacje.map((specialty, i) => (
          <div className='w-full border-b border-white hover-violet-800' title={specjalizacje.opis}>{specjalizacje.nazwa}</div>
        ))}
      </div>
    </>
  )
}
